import React from 'react';
import { useParams } from 'react-router-dom';
import UwcNavbar from "../uwc-navbar/uwc-navbar"
import "./vehicle-assign.css";

const VehicleAssign = () => {
    const params = useParams();
    const truckList = [
        {id: 0}, {id: 1},
        {id: 2}, {id: 3}
    ];
    const trollerList = [
        {id: 0}, {id: 1},
        {id: 2}, {id: 3}
    ];

    if (params.staffType === "janitor") { //janitor --> troller
        const rows = trollerList.reduce(function (rows, key, index) { 
            return (index % 2 === 0 ? rows.push([key]) 
            : rows[rows.length-1].push(key)) && rows;
        }, []);
    }
    else if (params.staffType === "collector") { //collector --> truck
        const rows = truckList.reduce(function (rows, key, index) { 
            return (index % 2 === 0 ? rows.push([key]) 
            : rows[rows.length-1].push(key)) && rows;
        }, []);
    }

    return (
      <div className="route-management">
        <UwcNavbar/>
        <span className="vehicle-assign-title">VEHICLE ASSIGNMENT</span>
        <div className="vehicle-assign-body">
            <div className="vehicle-group">
                <span className="vehicle-group-title">Troller</span>
                <table className="vehicle-table">
                    <colgroup>
                      <col span="1" style={{width: 40 + '%'}} />
                      <col span="1" style={{width: 40 + '%'}} />
                    </colgroup>
                    <tbody>
                        {rows.map((row) => (
                            <tr className="vehicle-table-row">
                                {row.map((col) => (
                                    <td className="vehicle-table-data">
                                        Vehicle ID #{col.id}
                                    </td>
                                ))}
                            </tr>
                        ))}
                        <tr className="vehicle-table-row">
                            <td className="vehicle-table-data">
                                Vehicle ID #00
                            </td>
                            <td className="vehicle-table-data">
                                Vehicle ID #01
                            </td>
                        </tr>
                        <tr className="vehicle-table-row">
                            <td className="vehicle-table-data">
                                Vehicle ID #02
                            </td>
                            <td className="vehicle-table-data">
                                Vehicle ID #03
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>

            <div className="vehicle-group">
                <span className="vehicle-group-title">Truck</span>
                <table className="vehicle-table">
                    <colgroup>
                      <col span="1" style={{width: 40 + '%'}} />
                      <col span="1" style={{width: 40 + '%'}} />
                    </colgroup>
                    <tbody>
                        <tr className="vehicle-table-row">
                            <td className="vehicle-table-data">
                                Vehicle ID #00
                            </td>
                            <td className="vehicle-table-data">
                                Vehicle ID #01
                            </td>
                        </tr>
                        <tr className="vehicle-table-row">
                            <td className="vehicle-table-data">
                                Vehicle ID #02
                            </td>
                            <td className="vehicle-table-data">
                                Vehicle ID #03
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
              
            <div className="btn-submit">
                <div className="btn-body">
                    <span className="btn-cancel">Cancel</span>
                </div>
                <div className="btn-body">
                    <span className="btn-save">Save</span>
                </div>
            </div>
        </div>
      </div>
    );
};
export default VehicleAssign;
